import React, {useState, useEffect} from 'react';
import {
  SafeAreaView,
  ScrollView,
  Text,
  View,
  Alert,
  StyleSheet,
  Button,
} from 'react-native';

import {enhetApi} from './api';

const App = () => {
  const [grunnskole, setGrunnskole] = useState({});
  const [vgs, setVGS] = useState({});
  const [names, setNames] = useState([])

  const getGrunnskole = async () => {
    try {
      const fetchedgrunnskole = await enhetApi.getEnheterWithSkolekategori('1');
      setGrunnskole(fetchedgrunnskole.data);
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }
  };

  const getVGS = async () => {
    try {
      const fetchedvgs = await enhetApi.getEnheterWithSkolekategori('2');
      setVGS(fetchedvgs.data);
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }

    let tmp = []
    for(let i = 0; i < Object.keys(grunnskole).length; i++) {
      tmp.push(JSON.stringify(grunnskole))
    } 
    setNames(tmp)

  };

  return (
    <SafeAreaView>
      <ScrollView>
        <View>
          <Button title="Get Grunnskole" onPress={() => getGrunnskole()} />
          <Button title="Get VGS" onPress={() => getVGS()} />
          {/* <Text style={styles.schools}>{Object.keys(grunnskole).length}</Text> */}
          <Text style={styles.schools}>{JSON.stringify(names)}</Text>

          <Text style={styles.schools}>{JSON.stringify(grunnskole)}</Text>
          <Text style={styles.schools}>{JSON.stringify(vgs)}</Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  button: {
    padding: 20,
    margin: 20,
    borderWidth: 4,
    borderColor: '#000',
    borderRadius: 10,
  },
  buttonText: {
    fontSize: 24,
    fontWeight: '900',
  },
  schools: {
    fontSize: 18,
    padding: 30,
    marginTop: 40,
  },
});

export default App;
